import React from 'react';
import './all.min.css'
import './Style.css'



function App(){
  const [Show,setShow]=React.useState(true)
  function Toggle(){
    setShow((v)=>!v)
  }
return(
<i onClick={Toggle} style={{color:Show?"#EEE":"red"}} class="fa-solid fa-star"></i>
)

}
export default App
